import './App.css';
import axios from 'axios'
import { useState } from 'react';
import { Button, CardGroup, Container, Row } from 'react-bootstrap'
import ListingCard from './components/ListingCard';

function App() {

  const [properties, setProperties] = useState([])

  const handleSubmit = async (event) => {
    event.preventDefault()
    await axios.get('http://localhost:8000/huurwoningenget/')
      .then(response => {
        setProperties(response.data)
        console.log(response.data)
      })
      .catch(error => {
        console.log('not worked')
        setProperties(['not good'])
      })
  }

  return (
    <Container>
      <h1 style={{textAlign: 'center'}}>Huurwoningen's listings </h1>
      <div className="d-flex align-items-center justify-content-center">
        <Button className="d-inline me-3" onClick={handleSubmit} variant="dark">Get</Button>        
        <Button className="d-inline" onClick={handleSubmit} variant="dark">Update</Button>        
      </div>
      <Row className="g-4 pt-3">
        <CardGroup>
          {properties.map((element, index) => {
            return(
              <ListingCard element={element} index={index} rental_agency="Huurwoningen" />
            )
          })}
        </CardGroup>
      </Row>
    </Container>
  );
}

export default App;
